(6, 46, 'falto a clases', '2022-07-25', '01:59:09 PM'),
(7, 46, 'Decidió retirarse del proceso de formación debido a que no contaba con los recursos económicos para continuar asistiendo a las actividades del SENA, por tanto, decidió tomar una oferta de trabajo en la ciudad de Bucaramanga, el aprendiz solicitara el retiro voluntario vía correo electrónico a la Coordinación Académica.  ', '2022-07-25', '02:09:29 PM'),
(8, 45, 'Aprendiz afirma que su etapa lectiva finalizo en el mes de abril, y que actualmente se encuentra esperando iniciar las prácticas, sin embargo, debe algunas competencias como física e ingles, las cuales no ha podido superar puesto no ha logrado contactarse con los instructores vía WhatsApp, y el motivo por el que no asiste presencial a la sede es que tiene dificultades con el dinero para los transportes. ', '2022-07-25', '03:37:19 PM'),
(9, 34, 'Aprendiz solicito retiro voluntario en el mes de junio. ', '2022-07-25', '03:40:40 PM'),
(10, 33, 'Aprendiz actualmente se encuentra estudiando en la universidad, por lo que, los horarios de formación se cruzan con sus actividades universitarias motivo por el cual, no puede asistir a clases. ', '2022-07-25', '03:43:17 PM'),
(11, 32, 'Intento de comunicación con el aprendiz fallido, debido a que, después de varias llamadas no hubo contestación telefónica. ', '2022-07-25', '03:46:51 PM'),
(12, 31, 'Teléfono registrado apagado', '2022-07-25', '10:45:14 PM'),
(13, 29, 'Número telefónico no activado. ', '2022-07-25', '03:48:09 PM'),
(14, 28, 'Aprendiz manifiesta que tuvo un inconveniente personales y no pudo empezarlo, por lo que, no continuara con el proceso de formación. ', '2022-07-25', '03:50:54 PM'),
(15, 36, 'No se logra establecer comunicación con el aprendiz, pese a los múltiples intentos. La llamada es rechazada. ', '2022-07-25', '03:54:23 PM'),
(16, 35, 'Aprendiz no responde a llamadas realizadas. ', '2022-07-25', '03:56:08 PM'),
(17, 27, 'El aprendiz manifiesta que obtuvo una oportunidad laboral, y por tanto, se retirara de la formación. ', '2022-07-25', '04:03:06 PM'),
(18, 26, 'Número telefónico no activado. ', '2022-07-25', '04:07:37 PM'),
